import styled from "styled-components";
import image from "../../assets/image/background-image.png";

const ThirdDescription = () => {
  return (
    <Container>
      <Image src={image} />
      <Title>강남토킹바</Title>
      <LittleTitle>
        이런 분들에게
        <br />
        추천드립니다.
      </LittleTitle>
      <Contents>
        1. 화류계에 질리신 대표님들
        <br />
        <br />
        2.매번 색다른 여성들을 만나고 싶으신 분들
        <br />
        <br />
        3.어린 20대 일반인 여성을 만나고 싶으신 분들
        <br />
        <br />
        투잡으로 정말 다양한 직업군의 여성분들이 50~60명씩 항시 대기중입니다.
        <br />
        매번 색다르고 질리지 않는 홀초이스 서비스로 대표님들을 만족시켜드립니다.
      </Contents>
    </Container>
  );
};
export default ThirdDescription;

const Container = styled.div`
    padding: 20px;
    border: 1px solid #000; // 필요에 따라 테두리 스타일을 조정하세요
    text-align: center;
`;

const ContentContainer = styled.div`
    display: flex;
    justify-content: space-between;
    align-items: flex-start;
    margin-top: 20px;
`;

const TextContainer = styled.div`
    display: flex;
    flex-direction: column;
    max-width: 50%;
    text-align: left;
`;

const Title = styled.h1`
    font-size: 24px;
    margin: 0 auto; // 가운데 정렬을 위한 설정
`;

const LittleTitle = styled.h2`
    font-size: 20px;
    margin-bottom: 10px;
`;

const Contents = styled.p`
    font-size: 16px;
    line-height: 1.5;
`;

const Image = styled.img`
    width: 480px;
    height: 480px;
    margin-left: 20px; // 텍스트와 이미지 사이의 간격을 설정합니다
`;
